●メーカー名：株式会社エフ・アール・シー ●総受信周波数：422.050?422.300MHz（12.5KHzステップ）。●送信出力：10mW。●受信感度：-14dBμ以下（12dB　SINAD）。●受信方式：ダブルスーパーヘテロダイン方式。●電源電圧：DC3.6～4.5V（単3型アルカリ電池×3本別売）。●消費電流：受信待受け時　約50mA。●受信最大時：約140mA。●送信時：約70mA。●使用温度範囲：-10度～+50度。●サイズ：W58xH103xD28mm（突起物含まず）。●重量：約180g。●付属品：イヤホンマイク2個、ベルトクリップ2個。●交信距離の目安：市街地：約100～200m、見通しの良い郊外：1～2km。 ●20チャンネル。他社製の特定小電力トランシーバー含め、9ch・11ch・20ch機種と交信可能です。●38グループモード。グループ機能を使用することにより、同じグループでのみ快適に通話をすることが出来ます。●音声に反応し、送信ボタンを押さなくても、マイクに向かって話すだけで自動送信されます。ベルトクリップやネクタイピン式イヤホンマイクがセットですので、ハンズフリーで話せるので便利です。●単3型アルカリ乾電池で約60時間運用。 

